import logo from './BlackWings.png';
import './App.css';

function AppBlackWings() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <input
        type='submit'
        value="Continuar" />
      </header>
      <div className='Datos-text'>
        <p>Datos</p>
      </div>
    </div>
  );
}

export default AppBlackWings;
